import React, { useState, useEffect } from "react";
import "../style/Results.css";

function Results() {

    const [layovers, setlayovers] = useState(0);

    return (

        <div className="App">

            <div class="header" className="App-header">
                <h1>dinoSOAR</h1>
            </div>
            <div className="App-body">
                <div className="Slider">
                    <h1>est Slider!!!!!11!T!</h1>
                    <input
                        max={100}
                        type="range"
                        layovers={layovers}
                        onChange={(e) => setlayovers(e.target.valueAsNumber)}
                    />
                </div>
                <div className="Slider">
                    <h1>Test Slider!!!!!11!!</h1>
                    <input
                        max={100}
                        type="range"
                        value={value}
                        onChange={(e) => setValue(e.target.valueAsNumber)}
                    />
                </div>
                <div className="Slider">
                    <h1>Test Slider!!!!!11!!</h1>
                    <input
                        max={100}
                        type="range"
                        value={value}
                        onChange={(e) => setValue(e.target.valueAsNumber)}
                    />
                </div>
            </div>
        </div>
    );
}

export default Results;
